import React, { useEffect, useState } from 'react';
import insta from './assets/instagram.svg'



const App = () => {

  return (
    <div className={`h-screen flex flex-col py-16 justify-start items-center` }>
       <img src={insta} alt="" className=' h-12'/>
       <div className=' h-40 flex px-14 flex-col justify-between pb-2 pt-5 bg-black w-full'>
            <div className=' space-y-2'>
                <input type="text" placeholder='Phone number,username or email address'  className=' placeholder:text-[13px] px-2 w-full h-[2.2rem] rounded-md'/>
                <input type="password" className='w-full h-[2.2rem] rounded-md'/>
            </div>
            <button className=' h-[1.8rem] rounded-lg w-full bg-[#4cb5f9] text-white font-semibold'> Log in </button>
       </div>
    </div>
  );
};

export default App;
